import React, { useState, useEffect } from "react";
import "./UserDashboard.css";

function UsuarioDashboard() {
  const [showModal, setShowModal] = useState(null);
  const [modalContent, setModalContent] = useState(""); 
  const [reclamos, setReclamos] = useState([]);
  const [filtro, setFiltro] = useState({ edificio: '', unidad: '', tipo: '', estado: '', fecha: '' });
  const [jwtToken] = useState(localStorage.getItem("jwtToken"));  // Assuming token storage

  useEffect(() => {
    fetchMisReclamos();
  }, []);

  const handleApiCall = async (url, options) => {
    try {
      const response = await fetch(url, options);
      if (!response.ok) {
        const data = await response.json();
        throw new Error(data.message || 'Error desconocido');
      }
      return await response.json();
    } catch (error) {
      console.error('Error en la solicitud:', error);
      alert(`Error: ${error.message}`);
      return null;
    }
  };

  const fetchMisReclamos = async () => {
    const url = "http://localhost:8080/api/reclamos/mis-reclamos";
    const options = {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${jwtToken}`,
      },
    };
    const data = await handleApiCall(url, options);
    if (data) {
      setReclamos(data);
      formatReclamos(data);
    }
  };

  const formatReclamos = (data) => {
    const formatted = data.map((reclamo, index) => (
      `Reclamo ${index + 1}:
      - ID Reclamo: ${reclamo.id}
      - Documento de Reclamante: ${reclamo.documento || 'No disponible'}
      - Código de Edificio: ${reclamo.codigoEdificio}
      - Ubicación: ${reclamo.ubicacion}
      - Identificador de Unidad: ${reclamo.identificadorUnidad || 'N/A'}
      - Descripción: ${reclamo.descripcion}
      - ID Tipo Reclamo: ${reclamo.idTipoReclamo}
      - Estado: ${reclamo.estado}
      - Detalle Estado: ${reclamo.detalleEstado}
      - Fecha: ${reclamo.fecha}\n`
    )).join("\n");
    setModalContent(formatted);
  };

  const applyFilters = () => {
    let filteredReclamos = reclamos;
    if (filtro.edificio) {
      filteredReclamos = filteredReclamos.filter(r => r.codigoEdificio === filtro.edificio);
    }
    if (filtro.unidad) {
      filteredReclamos = filteredReclamos.filter(r => r.identificadorUnidad === filtro.unidad);
    }
    if (filtro.tipo) {
      filteredReclamos = filteredReclamos.filter(r => r.idTipoReclamo === filtro.tipo);
    }
    if (filtro.estado) {
      filteredReclamos = filteredReclamos.filter(r => r.estado === filtro.estado);
    }
    if (filtro.fecha) {
      filteredReclamos = filteredReclamos.filter(r => new Date(r.fecha).toDateString() === new Date(filtro.fecha).toDateString());
    }
    formatReclamos(filteredReclamos);
  };

  return (
    <div className="user-dashboard">
      <header className="dashboard-header">
        <h1 className="dashboard-title">PROPSUITE</h1>
        <nav className="header-buttons">
          <div className="dropdown">
            <button className="nav-button">Usuario</button>
            <ul className="dropdown-menu">
              <li><button className="dropdown-item" onClick={() => setShowModal("actualizarNombreUsuario")}>Actualizar nombre de usuario</button></li>
              <li><button className="dropdown-item" onClick={() => setShowModal("restablecerContrasena")}>Restablecer contraseña</button></li>
              <li><button className="dropdown-item" onClick={() => setShowModal("cerrarSesion")}>Cerrar sesión</button></li>
            </ul>
          </div>
        </nav>
      </header>
      <div className="welcome-section">
        <h2 className="welcome-title">Bienvenidos a PROPSUITE</h2>
        <p className="welcome-subtitle">Diseñado para hacer tu gestión fácil y dinámica.</p>
      </div>
      <div className="section-container">
        <h2 className="section-title">Reclamos</h2>
        <button className="section-button" onClick={fetchMisReclamos}>Mis Reclamos</button>
        {/* Add buttons for each filter type here, each button would call applyFilters function with appropriate filter set */}
      </div>
      {/* Modal for displaying claims */}
      {showModal === "verMisReclamos" && (
        <div className="modal">
          <div className="modal-content custom-modal">
            <h2 className="modal-title">Mis Reclamos</h2>
            <pre>{modalContent || "No hay reclamos disponibles."}</pre>
            <div className="modal-buttons">
              <button className="section-button" onClick={() => setShowModal(null)}>Cerrar</button>
            </div>
          </div>
        </div>
      )}
      {/* More modals for other actions can be added here */}
    </div>
  );
}

export default UsuarioDashboard;
